import React, { useState } from 'react';
import axios from 'axios';
import { getPicId, picId } from './home';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';

//let picId = [1, 2, 3]

const Display = () => {
    //console.log(JSON.stringify(picId))
    const pictures = JSON.stringify(picId);
    const topPics = JSON.parse(pictures).topk;
    console.log(topPics)
    const itemData = [
        {
            img: 'https://unsplash.com/photos/' + topPics[0] + '/download?w=320',
            rows: 2,
            cols: 2,
        },

    ];
    return (
        <div>
            <h1>Check your pics</h1>
            <ImageList sx={{ width: 500, height: 450 }} variant="woven" cols={3} gap={8}>
                {itemData.map((item) => (
                    <ImageListItem key={item.img}>
                        <img
                            src={`${item.img}?w=161&fit=crop&auto=format`}
                            srcSet={`${item.img}?w=161&fit=crop&auto=format&dpr=2 2x`}
                            alt={item.title}
                            loading="lazy"
                        />
                    </ImageListItem>
                ))}
            </ImageList>
        </div>
    );
};

export default Display;
